    <>
<div class="container mx-auto px-4 py-8 rounded-full bg-white">
        <ul class="flex space-x-6">
            <li class="text-indigo-900 font-bold">INICIO</li>
            <li class="text-indigo-900 font-bold">TECNOLOGÍAS</li>
            <li class="text-indigo-900 font-bold">EXPERIENCIA Y EDUCACIÓN</li>
            <li class="text-indigo-900 font-bold">PROYECTOS</li>
        </ul>
    </div>
    </>
  )
}

export default Nav
